// Obtener historial de actividad
export const getActividad = (req, res) => {
    try {
        const data = readData();

        // Si no existe la colección 'permisosActividad', devolver array vacío
        const actividad = data.permisosActividad || [];

        // Ordenar por fecha (más reciente primero)
        const actividadOrdenada = [...actividad].sort((a, b) => {
            return new Date(b.fecha) - new Date(a.fecha);
        });

        return res.status(200).json({
            success: true,
            actividad: actividadOrdenada
        });
    } catch (error) {
        console.error('Error al obtener historial de actividad:', error);
        return res.status(500).json({
            success: false,
            message: 'Error al obtener historial de actividad',
            error: error.message
        });
    }
};

